import React from 'react';
import './Home.scss'
import LogoReact from '../img/logo.svg'


function Home() {

 


    return ( 

        <section className='home--container'>
           
          <div className='logo--side'> 
           <img src={LogoReact}> </img>

          </div>
          <div className='info--side'> 
            Info
          </div>

          

        </section>

        
     );
}

export default Home;
